  getPhoto = () => {
    this.service.login({username, password})
     .then(responFromapi=>this.setState({ albums:responFromapi }))
  };

  componentWillMount() {
    if (this.props.match.params.id) {
      this.getBeer(`single/${this.props.match.params.id}`);
    } else {
      this.getBeer("random");
    }
  }



